import axios from 'axios';
import {GET_RECIPES} from "./actionsType.js";




export function getRecipes(){
    return async(dispatch)=>{
        try{
            const recipes = "funciona"
            dispatch({type:GET_RECIPES, payload: recipes.data});
        }catch(err){
            return err;
        }
    }
}
